import{o as e,c as i,b as t}from"./app.8e08c8a3.js";const o='{"title":"Chocolate Chip Cookies","description":"","frontmatter":{},"headers":[{"level":2,"title":"Wet Ingredients","slug":"wet-ingredients"},{"level":2,"title":"Dry Ingredients","slug":"dry-ingredients"},{"level":2,"title":"Cookie Dough","slug":"cookie-dough"}],"relativePath":"code/index.md","lastUpdated":1615117657827}',l={},r=t('<h1 id="chocolate-chip-cookies">Chocolate Chip Cookies</h1><blockquote><p>This is an example of a simple chocolate chip cookie recipe provided for the purpose of explaining how to write a recipe in Markdown. Some things that make sense in notes like this one are #hashtags for categorizing recipes and website URLs for pointing to where a recipe came from.</p></blockquote><h2 id="wet-ingredients">Wet Ingredients</h2><ul><li>Butter | 2 sticks | Softened</li><li>Brown Sugar | 1 cup |</li><li>Sugar | 1/2 cup white |</li></ul><p>Mix together butter and sugar in a large bowl.</p><ul><li>Eggs | 2 |</li><li>Vanilla | 2 tsp |</li></ul><p>Mix the other wet ingredients into the butter and sugar mixture.</p><h2 id="dry-ingredients">Dry Ingredients</h2><ul><li>Flour | 3 cups |</li><li>Baking Soda | 1 tsp |</li><li>Salt | 1/2 tsp |</li></ul><p>Sift together dry ingredients in a separate bowl.</p><h2 id="cookie-dough">Cookie Dough</h2><p>Mix together dry ingredients with wet ingredients slowly.</p><ul><li>Chocolate Chips | 1 Cup |</li></ul><blockquote><p>Usually I add 2 cups...just because.</p></blockquote><p>Stir in ~1 cup or more of chocolate chips.</p><p>Bake at 350 for 12 minutes [Baking Cookies].</p><blockquote><p>Could be up to 15 min, or until lightly brown.</p></blockquote>',17);l.render=function(t,o,l,n,s,a){return e(),i("div",null,[r])};export default l;export{o as __pageData};
